import React, { useEffect, useState } from 'react'
import axiosInstance from '../../baseurl';

function ViewGym() {
    const [gymdata, setgdata] = useState([
        { name: "gym1", email: "testmail1", empid: 1, gender: "male" },
        { name: "gym2", email: "testmail2", empid: 2, gender: "female" },
      ]);

      
  useEffect(() => {

    axiosInstance
      .post(`/viewGyms`)
      .then((res) => {
        console.log(res, "gym");
        if (res.data.msg == "No Data obtained ") {
          setgdata([]);
        } else {
          setgdata(res.data.data);
        }
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  return (
    <div class="container-top">
        <div class="accordion" id="accordionExample">
         <div class="accordion-item">
            <h2 class="accordion-header">
              <button
                class="accordion-button collapsed"
                type="button"
                data-bs-toggle="collapse"
                data-bs-target="#collapseThree"
                aria-expanded="false"
                aria-controls="collapseThree"
              >
                View Gyms
              </button>
            </h2>
            <div
              id="collapseThree"
              class="accordion-collapse collapse"
              data-bs-parent="#accordionExample"
            >
              <div class="accordion-body">
                {/* gym details mapped */}
                {gymdata.length ? (
                  gymdata.map((a) => {
                    return (
                      <div class="card card-body">
                        <div className="main">
                          <div class="card" style={{ width: "18rem;" }}>
                            <div class="card-body">
                              <h5 class="card-title">Gym name : {a.name}</h5>
                              <h6 class="card-title">
                                Specialization : {a.specialization}
                              </h6>
                              <p class="card-text">Email : {a.email}</p>
                              <p class="card-text">Contact : {a.contact}</p>
                            </div>
                          </div>
                        </div>
                      </div>
                    );
                  })
                ) : (
                  <div class="card card-body">
                    <div className="main">
                      <div class="card" style={{ width: "18rem;" }}>
                        <div class="card-body">
                          <h5 class="card-title">No data</h5>
                        </div>
                      </div>
                    </div>
                  </div>
                )}
                {/* gym details mapped */}{" "}
              </div>
            </div>
          </div>
          </div>
    </div>
  )
}

export default ViewGym
